import { useLoaderData } from "react-router-dom";

export default function Review() {
    const data = useLoaderData();
  const reviews = useLoaderData().map((review) => {
    return (
      <Review
        key={review.id}
        title={review.title}
        body={review.body}
        name={review.userId}
      />
    );
  });
  return (
    <>
      <h1>Reviews</h1>
      {reviews[0]}
    </>
  );
}
